def profile(text, k, profile):
    hm = {'A': 0, 'C': 1, 'G': 2, 'T': 3}
    max_pro = float('-inf')
    max_k = ''
    for i in range(len(text) - k + 1):
        k_mer = text[i:i + k]
        pro = 1.0
        for idx, single_char in enumerate(k_mer):
            pro *= (profile[hm[single_char]][idx])
        if pro > max_pro:
            max_pro = pro
            max_k = k_mer
    return max_k




